import React from "react";
import Header from "./Header";
import TinderCards from "./TinderCards";
import "./App.css";
import Swipebutton from "./Swipebutton";

function App() {
  return (
    <div className="App">

            <Header />
            <TinderCards />
            <Swipebutton />
    </div>
  );
}
export default App;
